import React from 'react';
import s from './Skills.module.css';

function Skills() {
    return (
        <div>
            {/*header*/}
            <span>Ինչ եմ ես անում</span>

            {/* text about me*/}
            <span>CRAZY FULL STACK DEVELOPER WHO WANTS TO EXPLORE EVERY TECH STACK</span>

            <div>
                <img src="https://webref.ru/assets/images/book/html5.png" alt="HTML" />
                <img src="https://www.toolbox.am/img/trainings/icons//css3-logo.png" alt="CSS" />
                <img src="https://html5hive.org/wp-content/uploads/2014/06/js_800x800.jpg" alt="JavaScript" />
                <img src="https://avatars.githubusercontent.com/u/70142?s=200&v=4" alt="jQuery" />
                <img src="https://uxwing.com/wp-content/themes/uxwing/download/07-design-and-development/react-js.png" alt="React" />
                <img src="https://cdn.iconscout.com/icon/free/png-512/redux-283024.png" alt="Redux" />
                <img src="https://image.flaticon.com/icons/png/512/174/174881.png" alt="Wordpress" />
                <span>HTML CSS JavaScript jQuery React Redux Wordpress</span>
            </div>

            
            <div>
                <span>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Ipsa iure magnam dolores vel alias odit.</span>
                <span>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quod?</span>
                <span>Lorem ipsum dolor sit amet consectetur adipisicing elit. Tempora sequi aut aspernatur.</span>
            </div>

        </div>
    );
}

export default Skills;
